import React from "react";
import Img from "../Image/suraj.jpg";
import Style from "./Home.module.css";
const Home = () => {
  return (
    <div className={Style["home"]}>
      <div className={Style["home_description"]}>
        <div className={Style["home_description__brief"]}>
          <h2>Hi, I'm Suraj Poddar</h2>
          <p>
            I'm a Compitetive Programmer || Frontend Developer
          </p>
        </div>
        <div className={Style["home_description__connect"]}>Links</div>
      </div>
      <div className={Style["home_avatar"]}>
        <img src={Img} alt="avatar" />
      </div>
    </div>
  );
};

export default Home;
